import React from 'react';

class Search extends React.Component {
  state = {
    text: ''
  };

  render() {
    return (
      <div>
        <form action='' className='form'>
          <input
            type='text'
            name='text'
            placeholder='Search...'
            value={this.state.text}
          />
          <input
            type='submit'
            value='Search'
            className='btn btn-dark btn-block'
          />
        </form>
      </div>
    );
  }
}

export default Search;
